      SELECT DISTINCT + col0 AS col2, - CAST ( NULL AS REAL ) + - col2 * + col2 * - - CAST ( NULL AS REAL ) FROM tab2 (FORMAT parquet) cor0 WHERE NOT NULL = ( + col2 );
  - name: tab2

outputs:
  - name: q12203.out
    data: |
